import React, { Fragment } from "react";
import { Card, CardMedia } from "@material-ui/core";

const LeftPane = () => {
  return (
    <Fragment>
      <Card>
        <CardMedia
          style={{ height: 0, padding: "10%" }}
          image="../../../public/LeftPane.jpeg"
        />
      </Card>
    </Fragment>
  );
};

export default LeftPane;
